export class MLAWorksCitation {
  constructor(worksCitation) {
    this.worksCitation = worksCitation;
  }

  getWorksCitation() {
    return this.worksCitation;
  }

  setWorksCitation(worksCitation) {
    this.worksCitation = worksCitation;
  }

}
